import React from 'react';

export const ViewImageButton = () => {
    return (
        <>
        <div className='view-image__btn'>
            <img src="/assets/shared/icon-view-image.svg" alt="view-image" />
            <p>View Image</p>
        </div>
        </>
    )
}
